import React from "react";
import { Link } from "react-router-dom";

const tabsPetianos = props => {
  return (
    <div className="container">
      <div className="card-panel z-depth-3">
        <ul className="tabs">
          <li className="tab col s6">
            <Link
              style={{ color: "blue" }}
              to="#"
              //   onClick={props.handlePetianosAtivos}
            >
              Petianos atuais
            </Link>
          </li>
          <li className="tab col s6">
            <Link
              style={{ color: "blue" }}
              to="#"
              //   onClick={props.handlePetianos}
            >
              Egressos
            </Link>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default tabsPetianos;
